import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MenuIcon from '@mui/icons-material/Menu';

export default function Navbar() {

  return (
    
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position='relative' sx={{backgroundColor: 'black'}}>
        <Toolbar>

          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>

          <Button>Timesheet</Button>

          <Typography variant="h6" component="div" sx={{ flexGrow: 1, mt: 1}}>
            <img src="https://www.bestpromoandapparel.com/we/we.dll/Pic?UN=109646&F=C&T=707&Age=1313639451" alt='MAI banner'></img>
          </Typography>

          <Button>Inventory</Button>

          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <AccountCircleIcon />
          </IconButton>

        </Toolbar>
      </AppBar>
    </Box>
  );
}
